con:soapui-project.con:afterLoadScript:
log.info("begin project start up");

	project.properties.each { key, value ->
		log.info("pre-load project property " + key + "=" + value);
	}

log.info("read commandline value = " + project.context.expand( '${#Project#k1}' ));
log.info("read commandline value = " + project.context.expand( '${#System#k1}' ));
log.info("read commandline value = " + project.context.expand( '${#Global#k1}' ));
log.info("read commandline value = " + project.context.expand( '${#k1}' ));

log.info("load properties from file");
def propertiesFile = new File(new File(project.path).parent, 'LoadTestWithLightWeightAdapterComponents-soapui-project.properties');

if (propertiesFile.exists()) {
     def count=0;
	def props = new Properties()
	props.load(new FileReader(propertiesFile))
	props.each { key, value ->
          count=count+1;
		log.info("setting property " + key + "=" + value);
		project.setPropertyValue(key, value);
	}
	log.info("loaded " + count + " values");
}
log.info("load properties from file complete");

log.info("end project start up");
